<!doctype html>
<html>
<head>
  <meta charset="utf-8">
  <meta name="viewport" content="initial-scale=1.0">
  <title>fb-filename</title>
  <link href="http://fonts.googleapis.com/css?family=PT+Sans:400" rel="stylesheet" type="text/css">
  <link rel="stylesheet" href="css/standardize.css">
  <link rel="stylesheet" href="css/fb-filename.css">
</head>
<body class="body fb-filename clearfix">
  <header class="mainheader clearfix">
    <div class="container container-1 clearfix">
      <div class="linktitle linktitle-1 clearfix">
        <p class="text text-1">Homepage.jpeg</p>
        <p class="text text-2">2 Question</p>
      </div>
      <div class="linktitle linktitle-2 clearfix">
        <p class="text text-3">Feedback completion</p>
        <p class="text text-4">0/10</p>
        <div class="progressbar clearfix">
          <span class="_element"></span>
        </div>
      </div>
      <div class="container clearfix">
        <img class="image _image" src="images/switch-36x22.png" data-rimage data-src="images/switch-36x22.png" data-srcat2x="images/switch-36x22@2x.png">
        <p class="text text-5">Show question</p>
      </div>
    </div>
  </header>
  <div class="filefull js-filefull">
    <a class="qpop expand js-qpop" href="#">
      <img class="image submitted" src="images/closepop-318x331-1.png" data-rimage data-src="images/closepop-318x331-1.png" data-srcat2x="images/closepop-318x331-1@2x.png">
      <img class="image submit" src="images/openpop-318x328-1.png" data-rimage data-src="images/openpop-318x328-1.png" data-srcat2x="images/openpop-318x328-1@2x.png">
      <img class="image open" src="images/qfilepop-318x188-1.png" data-rimage data-src="images/qfilepop-318x188-1.png" data-srcat2x="images/qfilepop-318x188-1@2x.png">
    </a>
    <a class="qpop qpop-2 js-qpop" href="#">
      <img class="image submitted image-5" src="images/closepop-318x331.png" data-rimage data-src="images/closepop-318x331.png" data-srcat2x="images/closepop-318x331@2x.png">
      <img class="image submit image-6" src="images/openpop-318x328.png" data-rimage data-src="images/openpop-318x328.png" data-srcat2x="images/openpop-318x328@2x.png">
      <img class="image open" src="images/qfilepop-318x188.png" data-rimage data-src="images/qfilepop-318x188.png" data-srcat2x="images/qfilepop-318x188@2x.png">
    </a>
  </div>

  <script src="js/jquery-min.js"></script>
  <script src="js/fb-filename.js"></script>
  <script src="js/rimages.js"></script>
</body>
</html>
